export class DriverDataComponent {
  constructor(apiService, router, hereMap, httpClient, spinner, toastr, countryStateCity) {
    this.apiService = apiService;
    this.router = router;
    this.hereMap = hereMap;
    this.httpClient = httpClient;
    this.spinner = spinner;
    this.toastr = toastr;
    this.countryStateCity = countryStateCity;
    this.environment = environment.isFeatureEnabled;
    this.documentsTypesObects = {};
    this.title = "Driver List";
    this.mapView = false;
    this.listView = true;
    this.visible = true;
    this.dataMessage = Constants.FETCHING_DATA;
    this.drivers = [];
    this.loaded = false;
    this.statesObject = {};
    this.countriesObject = {};
    this.citiesObject = {};
    this.vehiclesObject = {};
    this.groupssObject = {};
    this.driverID = "";
    this.driverName = "";
    this.dutyStatus = "";
    this.driverType = null;
    this.suggestedDrivers = [];
    this.totalRecords = 10;
    this.pageLength = 10;
    this.lastEvaluatedKey = "";
    this.hideShow = {
      name: true,
      dutyStatus: true,
      location: true,
      currCycle: true,
      currVehicle: false,
      assets: false,
      contact: false,
      dl: true,
      document: false,
      status: true,
      groupID: true,
      citizenship: false,
      address: false,
      paymentType: false,
      sin: false,
      contractStart: false,
      homeTerminal: false,
      fastNumber: false,
      email: true,
      phone: true,
      driverType: true,
      startDate: true,
      licenceExpiry: true,
      licStateName: true
    };
    this.driverNext = false;
    this.driverPrev = true;
    this.driverDraw = 0;
    this.driverPrevEvauatedKeys = [""];
    this.driverStartPoint = 1;
    this.driverEndPoint = this.pageLength;
    this.loadMsg = Constants.NO_LOAD_DATA;
    this.isSearch = false;
    this.getSuggestions = _.debounce(function (value) {
      value = value.toLowerCase();

      if (value != "") {
        this.loadMsg = Constants.LOAD_DATA;
        this.apiService.getData(`drivers/get/suggestions/${value}`).subscribe(result => {
          if (result.length === 0) {
            this.loadMsg = Constants.NO_LOAD_FOUND;
          }

          if (result.length > 0) {
            result.map(v => {
              if (v.middleName != undefined && v.middleName != '') {
                v.fullName = `${v.firstName} ${v.middleName} ${v.lastName}`;
              } else {
                v.fullName = `${v.firstName} ${v.lastName}`;
              }

              return v;
            });
            this.suggestedDrivers = result;
          }
        });
      } else {
        this.suggestedDrivers = [];
      }
    }, 800);

    this.checkboxCount = () => {
      this.driverCheckCount = 0;
      this.drivers.forEach(item => {
        if (item.checked) {
          this.selectedDriverID = item.driverID;
          this.driverCheckCount = this.driverCheckCount + 1;
        }
      });
    };
  }

